import React,{useState} from 'react';

import './App.css';

function App() {


const [count , setCount] = useState(0)

function newNumb(){
  setCount(count + 1)
}


  return (
    <div className="App">
    <h1>World Counter</h1>
    <button onClick={newNumb}>{count} </button>
    </div>
  );
}

export default App;
